            <Link to="/">Dizin</Link>{' '}
            <Link to="/two">iki</Link>{' '}
            <Link to="/three">üç</Link>{' '}
            <Link to="/four">üç</Link>{' '}
            <Outlet/>
        </div>

    )
}
